import React from 'react'
import PropTypes from 'prop-types'

export const Header = (props) => {
  return (
    <nav classNameNameName="flex justify-between bg-gradient-to-r from-indigo-500 from 10% via-sky-500 via-30% to-emerald-500">
        <span classNameName="px-20 py-4 font-semibold text-xl text-white transform-gpu transition-transform hover:-translate-y-1">{props.title}</span>
        <ul classNameName="px-28 text-[17px] py-4 flex space-x-6 justify-end font-mono">
            <a href="#"><li classNameName="border-2 border-slate-200 hover:border-2 hover:border-slate-800 transform-gpu transition-transform text-white hover:bg-orange-500 hover:-translate-y-1 px-4 rounded-full py-[5px]">Home</li></a>
            <a href="Bot-Documentation/index.html"><li classNameName="border-2 border-slate-200 hover:border-2 hover:border-slate-800 transform-gpu transition-transform text-white hover:bg-orange-500 hover:-translate-y-1 px-4 rounded-full py-[5px]">Documents</li></a>
            <a href="https://github.com/SuperMuctec"><li classNameName="border-2 border-slate-200 hover:border-2 hover:border-slate-800 transform-gpu transition-transform text-white hover:bg-orange-500 hover:-translate-y-1 px-4 rounded-full py-[5px]">Github</li></a>
            <a href="https://discord.gg/fmHmS6bfAX"><li classNameName="border-2 border-slate-200 hover:border-2 hover:border-slate-800 transform-gpu transition-transform text-white hover:bg-orange-500 hover:-translate-y-1 px-4 rounded-full py-[5px]">Join Us</li></a>
            <button onclick="darkmode()" id = "darkmode-btn" classNameName="transform-gpu transition-transform hover:-translate-y-1"><img classNameName = "w-8" src="./src/dark.svg" alt=""/></button>
        </ul>
    </nav>
  )
}

Header.propTypes = {
    title: PropTypes.string
}
